module freq_div (
    input CLK_in,
    input RST,
    output reg CLK_50,
    output reg CLK_10,
    output reg CLK_1
);

reg [1:0] cnt_50;
reg [2:0] cnt_10;
reg [6:0] cnt_100;

always @(posedge CLK_in or posedge RST) begin
    if (RST) begin
        CLK_50 <= 0;
        CLK_10 <= 0;
        CLK_1 <= 0;
        cnt_50 <= 2'b00;
        cnt_10 <= 3'b000;
        cnt_100 <= 7'b0000000;
    end else begin
        // CLK_50 generation
        CLK_50 <= ~CLK_50;

        // CLK_10 generation
        if (cnt_10 == 3'b100) begin
            CLK_10 <= ~CLK_10;
            cnt_10 <= 3'b000;
        end else begin
            cnt_10 <= cnt_10 + 1;
        end

        // CLK_1 generation
        if (cnt_100 == 7'b1100001) begin
            CLK_1 <= ~CLK_1;
            cnt_100 <= 7'b0000000;
        end else begin
            cnt_100 <= cnt_100 + 1;
        end
    end
end

endmodule

module freq_div (
    input CLK_in,
    input RST,
    output reg CLK_50,
    output reg CLK_10,
    output reg CLK_1
);

reg [1:0] cnt_50;
reg [3:0] cnt_10;
reg [6:0] cnt_100;

always @(posedge CLK_in or posedge RST) begin
    if (RST) begin
        CLK_50 <= 0;
        CLK_10 <= 0;
        CLK_1 <= 0;
        cnt_50 <= 2'b00;
        cnt_10 <= 4'b0000;
        cnt_100 <= 7'b0000000;
    end else begin
        CLK_50 <= ~CLK_50;
        if (cnt_10 == 4'b1000) begin
            CLK_10 <= ~CLK_10;
            cnt_10 <= 4'b0000;
        end else begin
            cnt_10 <= cnt_10 + 1'b1;
        end

        if (cnt_100 == 7'b1111111) begin
            CLK_1 <= ~CLK_1;
            cnt_100 <= 7'b0000000;
        end else begin
            cnt_100 <= cnt_100 + 1'b1;
        end

        if (cnt_50 == 2'b11) begin
            cnt_50 <= 2'b00;
        end
    end
end

endmodule

